var title_f7_53_8024="Influence of cytokines on gut immune homeostasis";
var content_f7_53_8024=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F74195&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F74195&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 591px\">",
"   <div class=\"ttl\">",
"    Influence of cytokines on gut immune homeostasis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 571px; height: 433px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Neutrophil recruitment to the intestinal lamina propria in the early stages of inflammation is induced by IL-8, a chemokine secreted by macrophages. Interleukin (IL)-1 production can be stimulated by pro-inflammatory cytokines including tumor necrosis factor (TNF)-beta and IL-1-beta. Luminal antigen sampling by dendritic cells (DCs) occurs via transepithelial dendrite extensions, a process that depends on the CX3CR1 fractalkine receptor. Antigen-presenting cells including DCs drive type 1 T helper cell (Th1), Th17, or Th2 differentiation through the secretion of IL-12, IL-18, IL-27 (Th1) or IL-23, IL-6, transforming growth factor (TGF)-beta (Th17) or IL-4, and IL-27 (Th2). T effector cells secrete pro-inflammatory cytokines that lead to inflammation. CD1d-restricted natural killer (NK) T cells secrete IL-13 upon activation and lead to Th2 cytokine secretion. Suppression of inflammation can occur through naturally occurring thymic-derived Foxp3+ regulatory cells (Foxp3+ Treg), IL-10 producing T cells, or TGF-beta secreting T cells (Th3). Suppressive Foxp3+ T cells can also arise from Foxp3- T cells upon retinoic acid and TGF-beta stimulation via CD103+ DCs. NK cells have anti-inflammatory properties through the secretion of the suppressive cytokine IL-22. T-bet, GATA-3, ROR-gamma-t, and Foxp3 are transcription factors involved in Th1, Th2, Th17, and Treg differentiation, respectively.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Maillard MH, Snapper SB. Cytokines and chemokines in mucosal homeostasis. In: Inflammatory Bowel Diseases: Translating Basic Science into Clinical Practice, Targan SR, Shanahan F, Karp LC (Eds), Wiley-Blackwell, Oxford, UK 2010. Copyright &copy; 2010 Wiley-Blackwell.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
