" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Epidemiology of methicillin-resistant Staphylococcus aureus infection in adults",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?7/53/8026/contributors\">",
