"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?7/53/8026/contributors\">",
"     Deverick J Anderson, MD, MPH",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?7/53/8026/contributors\">",
