var title_f7_53_8027="Typical local reactions to mosquito bites";
var content_f7_53_8027=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F63430&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F63430&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Typical (normal) reactions to mosquito bites: Stages of development",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Stage",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical findings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        I",
"       </td>",
"       <td>",
"        No observable skin reaction (sensitization stage)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        II",
"       </td>",
"       <td>",
"        Delayed skin reaction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        III",
"       </td>",
"       <td>",
"        Immediate skin reaction followed by delayed skin reaction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        IV",
"       </td>",
"       <td>",
"        Immediate skin reaction only",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        V",
"       </td>",
"       <td>",
"        No reactivity (natural desensitization stage)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
