var title_f7_53_8028="AAST kidney injury scale";
var content_f7_53_8028=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F80576&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F80576&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    American Association for the Surgery of Trauma organ injury severity scale for the kidney",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Grade",
"       </td>",
"       <td class=\"subtitle1\">",
"        Type",
"       </td>",
"       <td class=\"subtitle1\">",
"        Description",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" rowspan=\"2\">",
"        I",
"       </td>",
"       <td>",
"        Contusion",
"       </td>",
"       <td>",
"        Microscopic or gross hematuria, urologic studies normal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hematoma",
"       </td>",
"       <td>",
"        Subcapsular, nonexpanding hematoma without parenchymal laceration",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"centered\" rowspan=\"2\">",
"        II",
"       </td>",
"       <td>",
"        Hematoma",
"       </td>",
"       <td>",
"        Nonexpanding perirenal hematoma confined to renal retroperitoneum",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Laceration",
"       </td>",
"       <td>",
"        Laceration &lt;1 cm depth of renal cortex without urinary extravasation",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"centered\">",
"        III",
"       </td>",
"       <td>",
"        Laceration",
"       </td>",
"       <td>",
"        Laceration &gt;1 cm depth of renal cortex without collecting system rupture or urinary extravasation",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"centered\" rowspan=\"2\">",
"        IV",
"       </td>",
"       <td>",
"        Laceration",
"       </td>",
"       <td>",
"        Parenchymal laceration extending through renal cortex, medulla, and collecting system",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vascular",
"       </td>",
"       <td>",
"        Main renal artery or vein injury with contained hemorrhage",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"centered\" rowspan=\"2\">",
"        V",
"       </td>",
"       <td>",
"        Laceration",
"       </td>",
"       <td>",
"        Completely shattered kidney",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vascular",
"       </td>",
"       <td>",
"        Avulsion of renal hilum, devascularizing the kidney",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Santucci RA, McAninch JW, Safir M, et al. Validation of the American Association for the Surgery of Trauma organ injury severity scale for the kidney. J Trauma 2001; 50:195. Copyright &copy; 2001 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
